import React, { useState } from 'react'
import axios from 'axios';
import Cookie from 'universal-cookie';
import Swal from 'sweetalert2'
import"./MonyTransfer.css"


const MonyTransfer = () => {
  const cookie = new Cookie()
  const token = cookie.get('bearer')

    const[accountNumberFrom,setaccountNumberFrom]=useState('');
    const[accountNumberTo,setaccountNumberTo]=useState('');
    const[typemony,settypemony]=useState('USD');
    const[description,setdescription]=useState('');
    const[typeto,settypeto]=useState('USD');
    const[amount,setamount]=useState('');
    const [loading , setLoading] = useState(false)


    function MonyFrom(e){
        settypemony(e.currentTarget.value)
      }
    function MonyTO(e){
        settypeto(e.currentTarget.value)
      }



    async function Submit(e) { 
    let Flage=true
    e.preventDefault();

    setLoading(true);
    if (accountNumberFrom===''||accountNumberTo===''||amount===''||description==='' ) {
        Flage=false
    }
    else{
        Flage=true;
    }
    if(Flage){

try{
  let res = await axios.post('http://127.0.0.1:8000/api/dotransaction',
  {
   accountNumberFrom:accountNumberFrom,
   accountNumberTo:accountNumberTo,
   typemony:typemony,
   typeto:typeto,
   amount:amount,
   description:description

  },{
   headers:{
     Authorization : 'Bearer ' + token
   }
 }
  )
  .then((response)=>console.log(response));


  setLoading(false)
  await Swal.fire({
    position: 'center',
    icon: 'success',
    title: 'تم إجراء المناقلة  بنجاح',
    showConfirmButton: false,
    timer: 1500
  })
} catch(err){
  setLoading(false)
  Swal.fire({
    icon: 'error',
    title: 'حدث خطأ ما',
    text: 'تعذر إضافة الموظف',
  })
  console.log(err)
}
   
    }
    
}



  return (
    <div className="" >
        <form className="" onSubmit={Submit}>
        <h3 className="h3 text-danger ">تحويل المال بين الحسابات  </h3>

<div className=" "  >
   
<div className="mb-3 col" >

 <label htmlFor="exampleInputID23" className=" text-danger">نوع المال المرسل</label>

<select id='exampleInputID23' className="" onChange={MonyFrom} >
          <option value='USD'>
          USD
            </option>
          <option value='TRY'>
            TRY
            </option>
           <option value='EUR'>
           EUR
        </option>
        </select>
  </div>

  <div className="mb-3 col">
    <label htmlFor="exampleInputaccf" className=" text-danger" >رقم حساب المرسل </label>
    <input type="number" className=""
     id="exampleInputaccf" aria-describedby="emailHelp" 
     name="accountNumberFrom" required
     value={accountNumberFrom}
     onChange={(e)=>setaccountNumberFrom(e.target.value)}
     />
     </div>
 </div> 

<div className='row' >
  <div className="mb-3 col" >

<label htmlFor="exampleInputID" className=" text-danger">نوع المال المستقبل</label>

<select id='exampleInputID' className="" onChange={MonyTO} >
         <option value="USD">
         USD
           </option>
         <option value='TRY'>
           TRY
           </option>
          <option value='EUR'>
          EUR
       </option>
       </select>
 </div>
 <div className="mb-3 col">
    <label htmlFor="exampleInputacct" className=" text-danger">رقم حساب المستقبل </label>
    <input type="number" className="" id="exampleInputacct" name="accountNumberTo" required
    value={accountNumberTo}
    onChange={(e)=>setaccountNumberTo(e.target.value)}
    />
  </div>
  </div>


  <div className="mb-3" >
    <label htmlFor="exampleInputamount" className=" text-danger">القيمة</label>
    <input type="number" className="" id="exampleInputamount" name="amount" required
    value={amount}
    onChange={(e)=>setamount(e.target.value)}
  />
  </div>


  <div className="mb-3">
    <label htmlFor="exampleInputdescription" className=" text-danger">الوصف </label>
    <input type="text" className=" " id="exampleInputdescription" name="description" required
    value={description}
    onChange={(e)=>setdescription(e.target.value)}
    />
  </div>


  <button type="submit" className="btn btn-danger">تحويل رصيد </button>
</form>
    </div>
  )
}

export default MonyTransfer
